import Layout from "./Layout";
import ReviewsCard from "./ReviewsCard";

const ReviewsSection = () => (
    <Layout>
        <div className="reviews-section-container">
            <ReviewsCard />
            <ReviewsCard />
            <ReviewsCard />
        </div>
    </Layout>

)

export default ReviewsSection
